func getOption() *MgoOption {
	op := &MgoOption{
		HostPorts: mgoHostPorts,
		Username:  "dbuser",
		Password:  "dbpasswd",
		Database:  "dev",
		// ConnOption:  "maxPoolSize=200&w=majority",
		ReadTimeout:  300,
		WriteTimeout: 300,
	}

	var minPool uint64 = 200
	var maxPool uint64 = 1000
	moreOptions := &options.ClientOptions{
		MaxPoolSize: &maxPool,
		MinPoolSize: &minPool,
	}
	op.MoreOptions = moreOptions

	return op
}

