func TestClient(t *testing.T) {
	op := &MgoOption{
		HostPorts:  mgoHostPorts,
		Username:   "dbuser",
		Password:   "dbpasswd",
		Database:   "dev",
		ConnOption: "maxPoolSize=20&w=majority",
	}
	t.Log(op)

	ctx, cancel := context.WithTimeout(context.Background(), 10*time.Second)
	defer cancel()

	client, err := mongo.Connect(ctx, options.Client().ApplyURI(op.uri()))
	if err != nil {
		t.Error(err)
	}

	defer func() {
		if err = client.Disconnect(ctx); err != nil {
			panic(err)
		}
	}()

	err = client.Ping(ctx, readpref.Primary())
	if err != nil {
		t.Error(err)
	}

	dataId := primitive.NewObjectID().Hex()
	data := &Sample{
		Id:      dataId,
		Name:    "axel",
		Age:     22,
		Created: time.Now().Unix(),
	}

	collection := client.Database(op.Database).Collection("test")
	res, err := collection.InsertOne(ctx, data)
	if err != nil {
		t.Error(err)
	}
	t.Log(res)

	// get data back
	query := bson.M{
		"_id": "62d1094b699957a7515be2e4",
	}

	resp := collection.FindOne(ctx, query)
	t.Log(resp.Err())

	var respData Sample
	err = resp.Decode(&respData)
	if err != nil {
		t.Error(err)
	}

	t.Log(respData.Id)

	t.Log(resp)

}

func TestMgoClient_C(t *testing.T) {
	op := getOption()

	ds := NewDataSource(op)
	defer ds.Close()

	var wg sync.WaitGroup
	maxGoRoutines := make(chan struct{}, defaultMaxPoolSize)

	for i := 0; i < 20000; i++ {
		wg.Add(1)
		go func(i int) {
			defer wg.Done()
			maxGoRoutines <- struct{}{}
			// t.Log(ds.client.NumberSessionsInProgress())
			// writeData(ds)
			fmt.Println("doing:", i)
			writeConsent(ds)
			fmt.Println("finished:", i)
			<-maxGoRoutines
		}(i)
	}
	wg.Wait()
}

func writeData(ds *DataSource) string {
	collectionName := "test"
	data := generateData()
	resp, err := ds.C(collectionName).InsertOne(ds.WriteContext(), data)
	if err != nil {
		panic(err)
	}
	fmt.Println(data.Id, resp.InsertedID)
	return data.Id
}

func writeConsent(ds *DataSource) string {
	collectionName := "test-consent"
	data := generateSampleConsent()
	resp, err := ds.C(collectionName).InsertOne(ds.WriteContext(), data)
	if err != nil {
		fmt.Println(err)
		return err.Error()
	}
	fmt.Println("writeConsent", data.Id, resp.InsertedID)
	return data.Id
}

func getData(ds *DataSource, id string) *Sample {
	collectionName := "test"
	query := bson.M{
		"_id": id,
	}
	var data *Sample
	err := ds.C(collectionName).FindOne(ds.ReadContext(), query).Decode(&data)
	if err != nil {
		panic(err)
	}
	fmt.Println("query data: ", data.Id)

	return data
}

func updateData(ds *DataSource, id string, update *bson.M) {
	collectionName := "test"

	resp, err := ds.C(collectionName).UpdateByID(ds.WriteContext(), id, update)
	if err != nil {
		fmt.Println(err)
	}
	fmt.Println(resp)
}

func TestCRUD(t *testing.T) {
	op := getOption()
	ds := NewDataSource(op)
	defer ds.Close()

	// create
	did := writeData(ds)

	// read data
	data := getData(ds, did)
	t.Log(data)

	// update Data
	update := &bson.M{
		"$set": bson.M{
			"name":    "hellojack",
			"created": time.Now().Unix(),
		},
	}

	updateData(ds, did, update)
}

func TestWriteConsent(t *testing.T) {
	op := getOption()
	ds := NewDataSource(op)
	defer ds.Close()

	// create
	did := writeConsent(ds)
	t.Log("writeConsent:", did)
}

func TestTransaction(t *testing.T) {
	op := getOption()
	ds := NewDataSource(op)
	defer ds.Close()

	callback := func(sctx mongo.SessionContext) (interface{}, error) {
		return nil, nil
	}

	session, err := ds.Client().StartSession()
	if err != nil {
		t.Error(err)
	}
	defer session.EndSession(ds.WriteContext())

	result, err := session.WithTransaction(ds.WriteContext(), callback)
	if err != nil {
		t.Error(err)
	}

	t.Log(result)
}
